import OverHeadBar from "./OverHeadBar";
import React from "react";
import bandPic from "../assets/bandpic.jpg";

function AboutPage() {
    return (
        <div>
            <OverHeadBar currentPage='ABOUT'/>
            <img src={bandPic} alt="band picture"/>
        </div>
    )
}

export default AboutPage;
